$(document).ready(function() {

    // Modal Window

    $(".myBtn").click(function(){
        $(".modal").css("display", "block");
        $(".overlay").css("display", "block");
    });
    $(".close").click(function(){
        $(".modal").css("display", "none");
        $(".overlay").css("display", "none");
    });

    // Validator

    function formValidation( formButton ) {

        var arr = ["email", "phone", "password", "pass_password", "str", "date", "csrf"]; // Validation types

        // Function to Validation of input's types
        function typesValid( type, value, form) {
            if ( "email" === type) {
                var pEmail = /^(([^<>()[\]\\.,;:\s@\"]+(\.[^<>()[\]\\.,;:\s@\"]+)*)|(\".+\"))@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\])|(([a-zA-Z\-0-9]+\.)+[a-zA-Z]{2,}))$/;
                return pEmail.test( value ) && value !== "";
            }

            if ( "phone" === type) {
                var pPhone = /\+\d{2}[ ]\(\d{3}\)[ ]\d{3}[ ]\d{4}/;
                return pPhone.test( value ) && value !== "";
            }

            if ( "password" === type ) {
                return value.length >= 8;
            }

            if ( "pass_password" === type ) {
                var origin = form.find( "[data-valid-type='password']" ).val();
                return origin === value && value !== "";
            }

            if ( "str" === type ) {
                return value.length >= 2;
            }

            if ( "date" === type ) {
                var arrD = value.split(".");
                arrD[1] -= 1;
                var d = new Date(arrD[2], arrD[1], arrD[0]);
                return (d.getFullYear() === Number(arrD[2])) && (d.getMonth() === Number(arrD[1])) && (d.getDate() === Number(arrD[0]));
            }
            if ("csrf" === type) {
                return value !== "";
            }

        }

        // Main function what is triggered on form button (no Submit => Ajax)
        $("#" + formButton ).on("click", function() {

            var curForm = $("#" + formButton).parent(),
                count = curForm.find("input").length,
                objAjax = {};

            for ( var i = 0; i < count; i++ ) {

                var curInput = curForm.find("input").eq(i),
                    curType = curInput.data("valid-type"),
                    inArrTest = $.inArray(curType, arr);

                if ( -1 !== inArrTest ) {

                    objAjax[ curInput.attr("name") ] = curInput.val();

                    if ( typesValid( curType, curInput.val(), curForm )) {
                        curInput.parent().addClass("has-success");
                        curInput.parent().removeClass("has-error");
                    } else {
                        curInput.parent().addClass("has-error");
                        curInput.parent().removeClass("has-success");
                    }
                }
            }
            if ( curForm.find("div").hasClass("has-success") && ! curForm.find("div").hasClass("has-error") ) {
                // do before full validation of Ajax form
                $.post( "libs/rest.php",
                    {
                        formName: formButton,
                        data: objAjax
                    },
                    function() {
                        var url = "spasibo.html";
                        $(location).attr('href',url);
                    }
                );

            }
        })
    }

    // List forms to Valid
    formValidation( "do_application" );
    formValidation( "_button" );

    // Date Window

    $('#date').daterangepicker({
        "singleDatePicker": true,
        "autoUpdateInput": false,
        locale: {
            "format": 'DD.MM.YYYY',
            "daysOfWeek": [
                "Пн",
                "Вт",
                "Ср",
                "Чт",
                "Пт",
                "Сб",
                "Вс"
            ],
            "monthNames": [
                "Январь",
                "Февраль",
                "Март",
                "Апрель",
                "Май",
                "Июнь",
                "Июль",
                "Август",
                "Сентябрь",
                "Октябрь",
                "Ноябрь",
                "Декабрь"
            ]
        }
    }, function(chosen_date) {
        $('#date').val(chosen_date.format('DD.MM.YYYY'));
    });

    // Masks

    $('#phone').mask('+99 (999) 999 9999');
    $('#pho-num').mask('+99 (999) 999 9999');

    // Dropdown

    $('#type-work').on( "click", function() {

        $(".work-dropdown").slideDown(300);

    } );

    function addSelect( id ) {

        var select = $( "#" + id );

        select.on( "click", function() {

            var currentText = select.text();

            $("#type-work").val( currentText );
            $(".work-dropdown").slideUp(300);

        } );
    }

    addSelect( "dyplom-work" );
    addSelect( "curs-work" );
    addSelect( "dis-work" );
    addSelect( "kan-work" );
    addSelect( "sci-work" );

});
